import React from 'react';

const NavBar = () => {
  return (
    <div>
      <Link to="/login">
        <button type="button">
          Click Me!
        </button>
      </Link>
      <button onClick={(e) => console.log(e)}>Login</button>
      <button onClick={(e) => console.log(e)}>Register</button>
    </div>
  );
};

export default NavBar;
